// Import du module SCSS pour le style spécifique du footer
import './footer_module.scss';

// Définition du composant fonctionnel Footer
function Footer() {
    // Utilisation de la balise HTML <footer> pour une sémantique appropriée
    return (
        <footer className="footer">
            {/* Utilisation de la classe "footer-text" pour le style du texte.
                Mise à jour de l'année en cours de manière dynamique. */}
            <p className="footer-text">
                Copyright {new Date().getFullYear()} Argent Bank
            </p>
        </footer>
    );
}

// Exportation du composant Footer pour une utilisation dans d'autres parties de l'application
export default Footer;
